import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Desktop from './Desktop';
import './index.css';
import WorkoutPlan from './Components/WorkoutPlans';

const workoutPlanData = {
  workouts: [
    { name: 'Workout 1', reps: 10, sets: 3 },
    { name: 'Workout 2', reps: 12, sets: 4 },
    { name: 'Workout 3', reps: 8, sets: 4 },
    // Add more workout data as needed
  ],
};

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<Desktop />} />
      <Route path="/workout-plan/:id" element={<WorkoutPlan workouts={workoutPlanData.workouts} />} />
    </Routes>
  </Router>,
  document.getElementById('root')
);
